function toggleCheck(element) {
    var checkBox = $(element).parent().parent().find("input[type=checkbox]");
    if (checkBox.is(":checked")) {
        checkBox.removeProp("checked");
    } else {
        checkBox.prop("checked", "checked");
    };
};

